import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 46.2-1565.1 Penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-1565.1.md","filePath":"vacode/46.2-1565.1.md"}'),o={name:"vacode/46.2-1565.1.md"},i=r('<h1 id="§-46-2-1565-1-penalties" tabindex="-1">§ 46.2-1565.1 Penalties. <a class="header-anchor" href="#§-46-2-1565-1-penalties" aria-label="Permalink to &quot;§ 46.2-1565.1 Penalties.&quot;">​</a></h1><p>Any person violating any of the provisions of this article is guilty of a Class 1 misdemeanor. Any summons issued for any violation of any provision of this article relating to use or misuse of temporary license plates shall be served upon the dealership to whom the plates were issued or to the person expressly permitting the unlawful use, or upon the operator of the motor vehicle if the plates are used contrary to the use authorized pursuant to § <a href="http://law.lis.virginia.gov/vacode/46.2-1561/" target="_blank" rel="noreferrer">46.2-1561</a>.</p><p>1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0767" target="_blank" rel="noreferrer">767</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0615" target="_blank" rel="noreferrer">615</a>.</p>',3),s=[i];function n(l,p,c,h,_,f){return t(),a("div",null,s)}const g=e(o,[["render",n]]);export{u as __pageData,g as default};
